class Solution {
  int minimumCost(String source, String target, List<String> original, List<String> changed, List<int> cost) {
    final n = source.length;
    List<List<int>> dp = List.generate(n + 1, (_) => List.generate(n + 1, (_) => 1 << 30), growable: false);
    dp[0][0] = 0;

    for (int i = 0; i <= n; i++) {
      for (int j = 0; j <= n; j++) {
        if (i < n) dp[i + 1][j] = dp[i + 1][j].compareTo(dp[i][j]) > 0 ? dp[i][j] : dp[i + 1][j];
        if (j < n) dp[i][j + 1] = dp[i][j + 1].compareTo(dp[i][j]) > 0 ? dp[i][j] : dp[i][j + 1];
        for (int k = 0; k < original.length; k++) {
          if (i + original[k].length <= n && j + changed[k].length <= n && source.substring(i, i + original[k].length) == original[k] && target.substring(j, j + changed[k].length) == changed[k]) {
            dp[i + original[k].length][j + changed[k].length] = dp[i + original[k].length][j + changed[k].length].compareTo(dp[i][j] + cost[k]) > 0 ? dp[i][j] + cost[k] : dp[i + original[k].length][j + changed[k].length];
          }
        }
      }
    }

    return dp[n][n] == (1 << 30) ? -1 : dp[n][n];
  }
}
